var title_f11_41_11931="Dx criteria pain disorder";
var content_f11_41_11931=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F59089&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F59089&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    DSM-IV-TR diagnostic criteria for pain disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <strong>",
"         A.",
"        </strong>",
"        Pain in one or more anatomical sites is the predominant focus of the clinical presentation and is of sufficient severity to warrant clinical attention.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         B.",
"        </strong>",
"        The pain causes clinically significant distress or impairment in social, occupational, or other important areas of functioning.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         C.",
"        </strong>",
"        Psychological factors are judged to have an important role in the onset, severity, exacerbation, or maintenance of the pain.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         D.",
"        </strong>",
"        The symptom or deficit is not intentionally produced or feigned (as in Factitious Disorder or Malingering).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         E.",
"        </strong>",
"        The pain is not better accounted for by a mood, anxiety, or psychotic disorder and does not meet criteria for dyspareunia.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from the Diagnostic and Statistical Manual of Mental Disorders, Text Revision, Fourth Edition. Copyright &copy; 2000 American Psychiatric Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
