var title_f11_41_11932="Clindamycin dosing for adults";
var content_f11_41_11932=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F78758&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F78758&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dosing of clindamycin for adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Indication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose/formulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acne rosacea",
"       </td>",
"       <td>",
"        1 percent lotion, apply to affected area BID",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acne vulgaris",
"       </td>",
"       <td>",
"        1 percent lotion, apply to affected area BID",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Toxoplasma encephalitis",
"       </td>",
"       <td>",
"        900 mg IV Q8 hours or 600 mg PO Q6 hours for 3 to",
"6 weeks, then 300-450 mg PO Q6 to 12 hours (plus pyrimethamine 50 to 75",
"mg daily)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pneumocystis carinii pneumonia",
"       </td>",
"       <td>",
"        900 mg IV Q8 hours initially, then 450 mg PO Q6 hours (plus primaquine 30 mg PO QD)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Babesiosis",
"       </td>",
"       <td>",
"        300 to 600 mg IV or IM Q6 hours (plus quinine 650 mg Q4 to 6 hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pelvic inflammatory disease",
"       </td>",
"       <td>",
"        900 mg IV Q8 hours (plus gentamicin) followed by 450 mg PO QID for a total of 14 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\" rowspan=\"1\">",
"        Bacterial vaginosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Nonpregnant women",
"       </td>",
"       <td class=\"sublist_other\">",
"        2 percent cream, one full applicator intravaginally at bedtime for 7 days; (alternative regimen) 300 mg PO BID for 7 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Pregnant women",
"       </td>",
"       <td class=\"sublist_other\">",
"        300 mg PO BID for 7 days; topical cream should",
"        <strong>",
"         not",
"        </strong>",
"        be used in pregnant women",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\" rowspan=\"1\">",
"        Prophylaxis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Surgical - head and neck",
"       </td>",
"       <td class=\"sublist_other\">",
"        600 mg IV 1 to 2 hours preoperatively and continued Q8 hours for 4 doses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Bacterial endocarditis",
"       </td>",
"       <td class=\"sublist_other\">",
"        600 mg PO 1 hour prior to the procedure or 600 mg IV within 30 minutes of the procedure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Plasmodium falciparum malaria",
"       </td>",
"       <td>",
"        (Alternative regimen) 900 mg PO TID for 3 to 5 days (plus quinine)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
